import React from 'react'

const Row = ({item}) => {
  return (
    <tr>
        {Object.entries(item).map(([key, value])=> {
            return(
                <Cell key = {key} cellData = {JSON.stringify(value)}/>
            )
        })}
    </tr>
  )
}

export default Row
